function App() {
  const expense = [
    {
      id: 1,
      description: 'Car insurance',
      amount: 100,
      date: new Date(2022, 0, 1)
    },
    {
      id: 2,
      description: 'Health insurance',
      amount: 100,
      date: new Date(2022, 5, 5)
    },
    {
      id: 3,
      description: 'MTA',
      amount: 100,
      date: new Date(2022, 7, 7)
    },
    {
      id: 4,
      description: 'Gas',
      amount: 100,
      date: new Date(2021, 0, 1)
    }
  ]
  return (
    <div className="app">
      <h2>Let's get started!</h2>
      < ExpenseItem
       />
    </div>
  );
}

export default App;
